package com.ssm.util;
import okhttp3.FormBody;
import okhttp3.OkHttpClient;
import okhttp3.Request;
import okhttp3.Response;
import java.io.IOException;
import java.util.HashMap;
import java.util.Iterator;
import java.util.Map;

public class Face {
    public static void main(String[] args) throws IOException {
        Map<String, String> params = new HashMap<>();
        params.put("idcard", "430923200302122338");
        params.put("name", "陈灿");
        params.put("image", "data:image/jpeg;base64,");
        String result = postForm(params);
        System.out.println(result);
    }


    public static String postForm(Map<String, String> params) throws IOException {
        String url = "https://faceidcardb.shumaidata.com/getfaceidb";
        String appCode = "dc478afb65494543818552bd2a55d2d5";
        OkHttpClient client = new OkHttpClient.Builder().build();
        FormBody.Builder formbuilder = new FormBody.Builder();
        Iterator<String> it = params.keySet().iterator();
        while (it.hasNext()) {
            String key = it.next();
            formbuilder.add(key, params.get(key));
        }
        FormBody body = formbuilder.build();
        Request request = new Request.Builder().url(url).addHeader("Authorization", "APPCODE " + appCode).post(body).build();
        Response response = client.newCall(request).execute();
        String result = response.body().string();
        System.out.println(result);
        return result;
    }
}
